shaders.vertex:
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;

uniform int uEveryX; // 1, 10, 1
uniform int uEveryY; // 1, 10, 3
uniform float uA; // 0, 2, 1.1
uniform float uB; // 0, 2, 0.1

vec4 skip(vec4 color, vec2 coord, vec2 size, vec2 every, float a, float b) {
  coord *= size;
  if (all(lessThan(mod(coord, every), vec2(1.0, 1.0))))
    return color * vec4(a);
  return color * vec4(b);
}

void main(void)
{
  vec4 color = texture2D(uTexture, vTexCoord.st);
  gl_FragColor = skip(color, vTexCoord.st, uResolution,
                      vec2(float(uEveryX), float(uEveryY)),
                      uA, uB);
}
